import React from 'react';

function ResultDisplay({ result }) {
    return (
        <div>
            <h2>Analysis Result</h2>
            <p>Overall Score: {result.overall_score}</p>
            <h3>Recommendations:</h3>
            <ul>
                {result.recommendations.map((rec, index) => (
                    <li key={index}>{rec}</li>
                ))}
            </ul>
        </div>
    );
}
export default ResultDisplay;
